import React from "react";
import axios from "axios";
import Produto from "./Produto";
import "./index.css";
import MyHeader from "./Header.js";

export default class Container extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      feed: [
        { id: 1, descricao: "scarpin", quantidade: 10, valor: 150 },
        { id: 2, descricao: "oxford", quantidade: 20, valor: 140 },
        { id: 3, descricao: "bota", quantidade: 30, valor: 130 }
      ]
    };
  }

  componentWillMount() {
    axios
      .get("")
      .then(response => {
        console.log(response.data);
        this.setState({
          feed: [
            { id: 1, descricao: "SCARPIN", quantidade: 10, valor: 150 },
            { id: 2, descricao: "OXFORD", quantidade: 20, valor: 140 },
            { id: 3, descricao: "BOTA", quantidade: 30, valor: 130 }
          ]
        });
      })
      .catch(erro => console.log(erro));
  }

  render() {
    return (
      <div>
        <MyHeader />
        {this.state.feed.map(produto => (
          <Produto key={produto} nome={produto} />
        ))}
        Descrição Valor Quantidade
        {this.state.feed.map(item => {
          return (
            <div key={item.id}>
              <h4>
                {" "}
                {item.descricao}, {"    "} {item.quantidade}, {"     "}
                {item.valor}
              </h4>
            </div>
          );
        })}
      </div>
    );
  }
}
